import styles from "./Navbar.module.css";

const Navbar = (props) => {
  let HtmlNavbar = (
    <div className="h-screen">
      <div className={styles.container}>
        <p className="text-4xl">Navbar</p>
      </div>
      <div className="border-red-500 border-2 w-full h-screen">
        {props.component}
      </div>
    </div>
  );
  return HtmlNavbar;
};

export default Navbar;
